  root: {
    '& .MuiCardMedia-root:hover': {
      background: "green",
      cursor: 'pointer',
      display: "block"

    }
  }
}))


function ProjectCard() {
  const classes = useStyles()
  return (
    <Grid item xs={12} sm={4}>
      <Card style={{margin: "20px 10px"}} className={classes.root}>
        <CardMedia
        style={{height: "280px"}}
        image="https://lp-cms-production.imgix.net/news/2019/02/taj-mahal-monkey.jpg"
        />
        <div className="default" style={{display: "none"}}>
          this iss style
        </div>

      </Card>
    </Grid>
  )
}

export default ProjectCard
